ClearCollect(CategoryTable_Update,
    ForAll(CategoryTable,
        {
            ID: If(ID in Category_table.ID, ThisRecord.ID, Blank()),
            History: ThisRecord.History,
            LV1Order:ThisRecord.LV1Order,
            LV2Order:ThisRecord.LV2Order,
            OData__x004c_V1:ThisRecord.OData__x004c_V1,
            TeamName:ThisRecord.TeamName,
            Title:ThisRecord.Title,
            Users:ThisRecord.Users
        }
    )
);

//Filter(CategoryTable,Not(ID in Category_table.ID), Patch(CategoryTable, Defaults(CategoryTable), {ID:Blank()}));
If(
    CountRows(
        Filter(
            CategoryTable,
            Title = "" || Title = Blank()
        )
    ) > 0,
    Notify(
        "이름을 지정하지 않은 하위 메뉴가 있습니다.",
        NotificationType.Error,
        800
    ),
    Patch(
        Category_table,
        CategoryTable_Update
    );
    Notify(
        "저장하였습니다.",
        NotificationType.Success,
        800
    );
);

ClearCollect(
    CategoryTable,
    ShowColumns(
        Category_table,
        "Title",
        "OData__x004c_V1",
        "LV1Order",
        "LV2Order",
        "Users",
        "ID",
        "History",
        "TeamName"
    )
);
